import Header from '../komponen/header';
import Footer from '../komponen/footer';
import Head from 'next/head';


const Layout = (props) => (
    <div>
        <Head>
        <Header />
        {props.children}
        <Footer />
        </Head>
    </div>
)
export default Layout;
